import React from "react";
import Sidenavbar from "../../components/Sidenavbar/Sidenavbar";
import Headers from "../../components/Headers/Headers";


const AddStudent = () => {
  return (
    <div className="addstudent">
      <div>
        <Headers />
      </div>
      <div>
        <div>
          <Sidenavbar />
        </div>
        <div>
          <div>
            <Date />
          </div>
          <div>
            <Form />
          </div>
        </div>
      </div>
    </div>
  );
};

export default AddStudent;
